import { Subject } from 'rxjs';
import { environment } from 'src/environments/environment';
import * as i0 from "@angular/core";
import * as i1 from "@angular/common/http";
import * as i2 from "@angular/router";
const OKR_BASE_URL = environment.okrUrl;
export class CheetaOkrService {
    constructor(http, router) {
        this.http = http;
        this.router = router;
        this.okrUpdated = new Subject();
    }
    getOkrUpdateListener() {
        return this.okrUpdated.asObservable();
    }
    createOkr(okr) {
        return new Promise((resolve, reject) => {
            try {
                this.http
                    .post(OKR_BASE_URL, okr)
                    .subscribe(async (res) => {
                    this.okrUpdated.next(1);
                    resolve(res);
                });
            }
            catch (err) {
                reject(err);
            }
        });
    }
    getOkr() {
        return new Promise((resolve, reject) => {
            try {
                this.http.get(OKR_BASE_URL + localStorage.getItem('userId'))
                    .subscribe(async (res) => {
                    this.okrUpdated.next(1);
                    resolve(res.data);
                    console.log(res.data);
                }, (err) => {
                    reject(err);
                });
            }
            catch (err) {
                reject(err);
            }
        });
    }
    //function to delete tickets
    deleteOkr(id) {
        console.log(id);
        return new Promise((resolve, reject) => {
            try {
                this.http
                    .delete(OKR_BASE_URL + id)
                    .subscribe(async (res) => {
                    this.okrUpdated.next(1);
                    resolve(res);
                });
            }
            catch (err) {
                reject(err);
            }
        });
    }
}
